class SJISEncoder{
	static table = "".match(/.{8}/g).reduce((a, kvp) => {let v = parseInt(`0x${kvp}`); a[v >>> 16] = v & 0xffff; return a;}, {});
	static createBlob(text, option){
		let str = [];
		for(let ch of text){
			let uc = ch.codePointAt(0);
			if(!(uc in SJISEncoder.table)){
				return null;
			}
			let sc = SJISEncoder.table[uc];
			if(sc > 0xff){
				str.push(sc & 0xff, sc >>> 8);
			}else{
				str.push(sc);
			}
		}
		return new Blob([new Uint8Array(str)], option);
	}
	static validate(text){
		let error = [];
		let row = 1;
		let col = 1;
		for(let ch of text){
			if(ch == "\n"){
				row++;
				col = 1;
				continue;
			}
			let uc = ch.codePointAt(0);
			if(!(uc in SJISEncoder.table)){
				error.push(`${row}${col}:${ch}`);
			}
			col++;
		}
		return error;
	}
	static simulateHTML(node, prefix){
		if(node.nodeType == Node.ELEMENT_NODE){
			let sub = node.childNodes;
			let n = sub.length;
			for(let i = 0; i < n; i++){
				SJISEncoder.simulateHTML(sub[i], prefix);
			}
		}else if(node.nodeType == Node.TEXT_NODE){
			let content = document.createElement("span");
			let text = node.textContent;
			let subStr = "";
			for(let ch of text){
				if(ch.codePointAt(0) in SJISEncoder.table){
					subStr += ch;
					continue;
				}else if(subStr != ""){
					content.appendChild(document.createTextNode(subStr));
					subStr = "";
				}
				let unknown = Object.assign(document.createElement("span"), {textContent: String.fromCharCode(65533)});
				unknown.setAttribute("title", ch);
				if(prefix != null){
					unknown.setAttribute(`data-${prefix}-unknown`, "unknown");
				}
				content.appendChild(unknown);
			}
			if(content.firstElementChild != null){
				if(subStr != ""){
					content.appendChild(document.createTextNode(subStr));
				}
				if(prefix != null){
					content.setAttribute(`data-${prefix}-container`, "container");
				}
				node.parentNode.replaceChild(content, node);
			}
		}
	}
}